import React from 'react';
import search from './images/search_icon.png';
import Menu from './images/Menu.png';
import Einstellung from './images/Einstellungen.png';
import Info from './images/Info1.png';
import User from './images/icon_user.png';
import Calendar from './images/calendar.png';
import goBack from './images/backButton.png';
import Add from './images/add.png';
import './App.css';
const Team1 = () => {
    return (
        <div className="Teams">
            <header className="Homepage-header">    
                <img src={Menu} className="Menu" alt="menu" />  
                <img src={Info} className="Info" alt="info" />
        
                <img src={Einstellung} className="Einstellung" alt="settings" />
            </header>
            <div className='goBackButton'>
                <img src={goBack} className="goBack" alt="goBack" />
            </div>
            <div className="title">
                <b>Teams</b>
            </div>
            <div className='project-field'>
                <div className='proj-name'>
                    <b>Minispiele-Portal</b>
                </div>
                <div className='proj-info'>
                    <img src={User} className="icon-user" alt="user" />   Sandra Wickner 
                    <img src={Calendar} className="calendar" alt="calendar" />   Kein Zeitraum 
                    <img src={Warn} className="icon-warn" alt="warn" />   Keine Auswahl
                </div>
                <div className='proj-member'>

                </div>
                <div className='proj-details'>

                </div>
            </div>
        </div>
    );
};

export default Team1;
